import React, { useState } from 'react';
import axios from 'axios';
import { Container, Typography, TableContainer, Table, TableHead, TableBody, TableRow, TableCell, Paper, TextField, Button } from '@mui/material';

const GetTicketPage = () => {
  const [ticketId, setTicketId] = useState('');
  const [ticket, setTicket] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleInputChange = (e) => {
    setTicketId(e.target.value);
  };

  const fetchTicketById = async () => {
    if (!ticketId) {
      alert('Please enter a ticket ID');
      return;
    }
    setLoading(true);
    try {
      const response = await axios.get(`http://localhost:5000/tickets/${ticketId}`);
      setTicket(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching ticket:', error);
      setTicket(null);
      setLoading(false);
    }
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Get Ticket by ID
      </Typography>
      <TextField
        label="Ticket ID"
        value={ticketId}
        onChange={handleInputChange}
        fullWidth
        margin="normal"
      />
      <Button variant="contained" color="primary" onClick={fetchTicketById}>
        Fetch Ticket
      </Button>
      {loading ? (
        <p>Loading...</p>
      ) : ticket ? (
        <TableContainer component={Paper} style={{ marginTop: 20 }}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>ID</TableCell>
                <TableCell>Actual Price</TableCell>
                <TableCell>Comment</TableCell>
                <TableCell>Event Venues ID</TableCell>
                <TableCell>Image URL</TableCell>
                <TableCell>Listing Price</TableCell>
                <TableCell>Lock</TableCell>
                <TableCell>Orders ID</TableCell>
                <TableCell>Seller ID</TableCell>
                <TableCell>Selling Price</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>Type</TableCell>
                <TableCell>Validated On</TableCell>
                <TableCell>Verified</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              <TableRow key={ticket._id}>
                <TableCell>{ticket._id}</TableCell>
                <TableCell>{ticket.actualPrice}</TableCell>
                <TableCell>{ticket.comment}</TableCell>
                <TableCell>{ticket.eventVenuesID}</TableCell>
                <TableCell>{ticket.imageURL}</TableCell>
                <TableCell>{ticket.listingPrice}</TableCell>
                <TableCell>{ticket.lock.toString()}</TableCell>
                <TableCell>{ticket.ordersID}</TableCell>
                <TableCell>{ticket.sellerID}</TableCell>
                <TableCell>{ticket.sellingPrice}</TableCell>
                <TableCell>{ticket.status}</TableCell>
                <TableCell>{ticket.type}</TableCell>
                <TableCell>{ticket.validatedOn}</TableCell>
                <TableCell>{ticket.verified.toString()}</TableCell>
              </TableRow>
            </TableBody>
          </Table>
        </TableContainer>
      ) : (
        <p>No ticket data available</p>
      )}
    </Container>
  );
};

export default GetTicketPage;
